import React from "react";
import LogoutFunction from '../LogoutFunction'
export default function NavProfileHome() {
  return (
    <div>
    <nav className="nav justify-content-center">

<h1 className="white">Enki</h1>
</nav>
    <div>
    <button
            onClick={() => {
              localStorage.clear('token');
              clear()
            }}>
            Logout
          </button>
    </div>

 </div>
  );
}
